import React from 'react';
import './Project.css';

const Project = () => {
  const projects = [
    { title: "Tourism Website", className: "row1item1" },
    { title: "Jeopardy Quiz Game", className: "row1item2" },
    { title: "Dragon Ball Game", className: "row2item1" },
    { title: "Dictionary", className: "row2item2" },
    { title: "To-Do List", className: "row3item1" },
    { title: "Translator App", className: "row3item2" },
    { title: "Explorez - Travel App", className: "row4item1" },
    { title: "Weather Site", className: "row4item2" },
    { title: "Youtube Clone", className: "row5item1" },
    { title: "Pet Adoption App", className: "row5item2" },
    { title: "Pokemon Card Generator", className: "row6item1" },
  ];

  return (
    <div className="projpage-container">

      <div className="projects-grid">
        {projects.map((project, index) => (
          <div className={`project-item ${project.className}`} key={index}>
            <h2>{project.title}</h2>
            <p>{project.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Project;
